import React,{Component} from 'react';
import { Button } from 'antd';
import './App.css';
import Collapse1 from '../src/component/Collapse1'
import {flatternArr} from "./utility"

const TestData = {
        "story": {
            "name": "Social Images",
            "created_at": "2020-07-01T08:19:25.551Z",
            "published_at": "2020-10-09T10:08:55.552Z",
            "alternates": [],
            "id": 14688054,
            "uuid": "86a71e64-0ec4-4b80-ab46-fd422eddd872",
            "content": {
                "_uid": "c3a34517-359c-4b6f-b263-9a2bb3ee3414",
                "other": [
                    {
                        "_uid": "c1ff2a8f-b369-4bd6-95ed-f7b63b7a7be5",
                        "date": "2020-01-27 23:59",
                        "link": "https://www.instagram.com/p/B7zhnianq8J/",
                        "image": "https://res.cloudinary.com/castlery/image/upload/v1592821208/marketing/Cross-Market/instagram/ugc__tylayong.jpg",
                        "content": "Obsessed with our new mirror from @castleryau. üòç‚Å† I originally placed it beside our bed, but I was experimenting (much to @benyong_'s dismay) and I styled it in our study nook (see next slide)...‚Å† I don't know which place I like it better! Can you help me decide? üòÖ",
                        "disabled": false,
                        "variants": "23691",
                        "component": "instagram_post",
                        "ig_handle": "@tylayong"
                    },]
                }
            }
        }
        console.log(TestData,'TestData')
        console.log(TestData,'TestData')

class App extends Component {
    constructor(props) {
        super(props);
        this.state={}
    }
    render() {
        return super.render(
            <div className="App">
                <Button type="primary">Button</Button>
                <Collapse1/>
            </div>
        );
    }

}
;




export default App;
